import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { isAuthenticated } from "../auth";
import { getUserOrders } from "../user";

const Orders = () => {
  const { userId } = useParams();

  const [orders, setOrders] = useState();

  const { user, token } = isAuthenticated();

  const getUserOrderDetails = async (userId, token) => {
    try {
      const data = await getUserOrders(userId, token);
      if (data.error) {
        return console.log(data.error);
      } else {
        // console.log("typeof", typeof data);
        console.log("Data", data);
        return setOrders(data);
      }
    } catch (error) {}
  };

  useEffect(() => {
    getUserOrderDetails(userId, token);
  }, []);

  return (
    <section className="userBoard-right-section accounts-section">
      <h1 className="userBoard-right-header">Orders</h1>
      <div className="userBoard-right-subSec">
        <table className="userBoard-right-customer-order-table">
          <thead className="userBoard-right-customer-order-table-head-sec">
            <tr>
              <th className="userBoard-right-customer-order-table-head-value">Products</th>
              <th className="userBoard-right-customer-order-table-head-value">Order ID</th>
              <th className="userBoard-right-customer-order-table-head-value">Status</th>
              <th className="userBoard-right-customer-order-table-head-value">Total</th>
              <th className="userBoard-right-customer-order-table-head-value">Payment Mode</th>
              <th className="userBoard-right-customer-order-table-head-value">Delivery Boy</th>
              <th className="userBoard-right-customer-order-table-head-value">Action</th>
            </tr>
          </thead>
          <tbody className="userBoard-right-customer-order-table-body-sec">
            <tr>
              <td className="userBoard-right-customer-order-table-head-value"></td>
            </tr>
          </tbody>
        </table>
      </div>
    </section>
  );
};

export default Orders;
